import React from "react"
import "./Header.css"

function Header() {
    return (
        <nav className="bp3-navbar bp3-dark">
          <div className="bp3-navbar-group bp3-align-left">
            <div className="bp3-navbar-heading">Fetch commits</div>
            <input className="bp3-input" placeholder="owner" type="text" />
            <input className="bp3-input" placeholder="repo" type="text" />
            <input className="bp3-input" placeholder="author email" type="text" />
            <button className="bp3-button bp3-minimal bp3-icon-cog"></button>
          </div>
        </nav>
    )
}

function PostReq() {
  return (
    fetch('/fetch_and_save_commits/', {
      method: 'POST',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        firstParam: 'yourValue',
        secondParam: 'yourOtherValue',
      })
    })
    )
}

export default Header
